import React from 'react'
import axios from 'axios'

const ShowProducts = () => {
  const[products, setProducts] = usestate([])

    useEffect(() => {
        const getProductsData = async () => {
            const { data } = await axios.get('/api/products/allProducts')
            console.log(data)
            setProducts(data)
        }
        getProductsData()
    }, [])


}

export default ShowProducts
